var tf = require('@tensorflow/tfjs')

let model = null
let uri = window.location.href + 'modelJS/model.json'

export const loadModel = async () => {
	try{
		model = await tf.loadLayersModel(uri)
	}catch(e){
		console.log(e);
	}

	return model
}


export const predict = (model,imageData) => {
	const data = tf.fromPixels(imageData,1)
	const predictions = model.predict(data,{batchSize: 1})
	console.log(predictions);
}
